import { MyContext } from "../../App";
import { useEffect, useState } from "react";
import { useContext } from "react";
import { Link } from "react-router-dom";
import { FaFacebook, FaGoogle } from "react-icons/fa";

const SignIn = () => {
  const context = useContext(MyContext);
  const [email, setEmail] = useState("");
  const [password, setPassword] = useState("");

  useEffect(() => {
    context.setisHeaderFooterShow(false);

    // Cleanup function to restore header/footer when component unmounts
    return () => {
      context.setisHeaderFooterShow(true);
    };
  }, []);

  const handleSubmit = (e) => {
    e.preventDefault();
    // Handle login logic here
    console.log("Login attempt with:", email, password);
  };

  return (
    <section className="section" style={{ backgroundColor: "#F5F5DC", minHeight: "100vh", display: "flex", alignItems: "center", justifyContent: "center" }}>
      <div className="container">
        <div className="row justify-content-center">
          <div className="col-md-6 col-lg-5">
            <div className="card shadow">
              <div className="card-body p-5">
                <h3 className="text-center mb-4">Sign In</h3>

                <form onSubmit={handleSubmit}>
                  <div className="mb-3">
                    <label htmlFor="email" className="form-label">Email address</label>
                    <input 
                      type="email" 
                      className="form-control" 
                      id="email" 
                      value={email}
                      onChange={(e) => setEmail(e.target.value)}
                      required
                    />
                  </div>

                  <div className="mb-3">
                    <label htmlFor="password" className="form-label">Password</label>
                    <input 
                      type="password" 
                      className="form-control" 
                      id="password"
                      value={password}
                      onChange={(e) => setPassword(e.target.value)}
                      required
                    />
                  </div>

                  <div className="mb-3 text-end">
                    <Link to="/forgot-password" className="text-decoration-none">Forgot Password?</Link>
                  </div>

                  <div className="d-grid gap-2">
                    <button type="submit" className="btn btn-primary">Sign In</button>
                  </div>
                </form>

                <div className="divider d-flex align-items-center my-4">
                  <div className="border-bottom flex-grow-1"></div>
                  <span className="px-2 text-muted">OR</span>
                  <div className="border-bottom flex-grow-1"></div>
                </div>

                <div className="d-grid gap-2">
                  <button className="btn btn-outline-primary mb-2" style={{ backgroundColor: "#4267B2", color: "white" }}>
                    <FaFacebook className="me-2" /> Continue with Facebook
                  </button>
                  <button className="btn btn-outline-danger" style={{ backgroundColor: "white", color: "#DB4437", border: "1px solid #DB4437" }}>
                    <FaGoogle className="me-2" /> Continue with Google
                  </button>
                </div>

                <div className="text-center mt-4">
                  <p className="mb-0">Don't have an account? <Link to="/signup" className="text-decoration-none">Sign Up</Link></p>
                </div>
              </div>
            </div>
          </div>
        </div>
      </div>
    </section>
  );
}

export default SignIn;
